#include <fstream>
#include <algorithm>
#include <vector>

int main() {
    std::ifstream inFile("multimi.in");
    std::ofstream outFile("multimi.out");

    int n;
    inFile >> n;

    int maxStart = 0;
    int minEnd = 30000;

    for (int i = 0; i < n; ++i) {
        int start, end;
        inFile >> start >> end;
        maxStart = std::max(maxStart, start);
        minEnd = std::min(minEnd, end);
    }

    if (maxStart <= minEnd) {
        for (int i = maxStart; i <= minEnd; ++i) {
            outFile << i << " ";
        }
    } else {
        outFile << "multimea vida";
    }

    inFile.close();
    outFile.close();
    return 0;
}
